import React,{Component} from "react";

import "./Menu.css"
class Template extends Component{
    render() {

        return (
            <div>
                <p>Nazwa Przedmiotu {this.props.id}</p>
                <p>Cena Przedmiotu {this.props.id}</p>
            </div>
        )
    }
}
export default Template;
